// import logo from './logo.svg';
import './App.css';
import './Custom.css';
import Header from './MyComponent/Header';
import Home from './MyComponent/Home';
import Blog from './MyComponent/Blog';
import Footer from './MyComponent/Footer';

function App() {
  return (
    <div>
      <Header/>
      <Home/>
      <Blog/>
      <Footer />
    </div>
  );
}

export default App;
